import React from 'react';
import LoginForm from './LoginRegister/LoginForm';
import './App.css';
import GoogleButton from 'react-google-button'

function App() {
  return (
    <div className="app">

      <div className="left">
        <div className="loginText">
        <h4>Welcome back</h4>
      <h6>Login to continue documenting</h6>
      <GoogleButton
  onClick={() => { console.log('Google button clicked') }}
/>
        </div>
        <LoginForm />
        <div class='loginFooter'>
  <p><a href="forgot_password_page.html">Forgot password?</a></p>
  <p><a href="signup_page.html">Don't have an account?</a></p>
</div>

      </div>
      <div className="right">
        <div className="logo">
        <img src={process.env.PUBLIC_URL + '/png-transparent-super-man-illustration-batman-v-superman-dawn-of-justice-batman-v-superman-dawn-of-justice-superman-logo-superman-heroes-superhero-dc-comics.png'} alt="Logo" />

        </div>
        <div className="text">
          Dcoumenting as a developer has never been so simple.
        </div>
      </div>
    </div>
  );
}

export default App;
